public void applicationFinished(ApplicationId applicationId) {
  if (!tokenKeepAliveEnabled) {
    removeApplicationFromRenewal(applicationId);
  } else {
    delayedRemovalMap.put(applicationId, System.currentTimeMillis()
        + tokenRemovalDelayMs);
  }
}
